class BottleneckBlock(nn.Module):
    def __init__(self, in_features, bottleneck_size, out_features):
        super(BottleneckBlock, self).__init__()
        self.fc = nn.Sequential(
            nn.Linear(in_features, bottleneck_size),
            nn.ReLU(),
            nn.Linear(bottleneck_size, out_features)
        )
        self.shortcut = nn.Linear(in_features, out_features) if in_features != out_features else nn.Identity()

    def forward(self, x):
        return nn.ReLU()(self.fc(x) + self.shortcut(x))

